import React from 'react';

// Import elements
import {
    Banner,
    ArticleWrapper,
    ArticleTitle,
    ArticleBody,
    ArticleSubTitle,
    ArticleQuickLinks,
    Seperator,
} from './elements';

const ArticleInner = () => {
    return (
        <>
            <main>

                {/* Banner */}
                <Banner/>

                {/* Article content */}
                <ArticleWrapper>

                    {/* Article title */}
                    <ArticleTitle>
                        The different forms of blockchain
                    </ArticleTitle>

                    <ArticleBody>

                        {/* Article subtitle */}
                        <ArticleSubTitle>
                            And what we use for our trading platform
                        </ArticleSubTitle>

                        {/* Article quicklinks */}
                        <ArticleQuickLinks>
                            <div>
                                Beyco | Oct 5 | 4 min read
                            </div>
                            <div>
                                Social icons
                            </div>
                        </ArticleQuickLinks>
                    </ArticleBody>
                </ArticleWrapper>
            </main>
        </>
    )
}

export default ArticleInner;
